describe('datagrep.linearAlgebra', () => {
  const { csv, linearAlgebra } = utils
  const {
    add,
    angle,
    crossproduct,
    dot,
    isParallel,
    isOrthogonal,
    magnitude,
    multiply,
    normalize,
